import React, { Component } from 'react';
import {BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';


class App extends Component {





  render(){
    return (
        <Router>
      <div className="App">
        <Route path='./components/doodle.js'> Hallo </Route>

      </div>
      </Router>
    );
  }
}

export default App;
